import React from "react";
import Header2 from "../Components/Header2";
import { Link } from "react-router-dom";

function PNP() {
  return (
    <>
      <div>
        <Header2 title={"Page Not Found"} />
        {/* 404 Start */}
        <div className="container-xxl py-5 wow fadeInUp" data-wow-delay="0.1s">
          <div className="container text-center">
            <div className="row justify-content-center">
              <div className="col-lg-6">
                <i className="bi bi-exclamation-triangle display-1 text-primary" />
                <h1 className="display-1">404</h1>
                <h1 className="mb-4">Page Not Found</h1>
                <p className="mb-4">
                  Weâ€™re sorry, the page you have looked for does not exist in
                  our website! Maybe go to our home page or try to use a search?
                </p>
                <Link className="btn btn-primary rounded-pill py-3 px-5" to="/">
                  Go Back To Home
                </Link>
              </div>
            </div>
          </div>
        </div>
        {/* 404 End */}
      </div>
    </>
  );
}

export default PNP;
